import React from 'react';
import '../css/pricing.css'
function Pricing () {
  
    
    const package_submit=(e,str)=>{
      e.preventDefault();
      sessionStorage.setItem('pricing_package',);

    }

        return (
      <div id="generic_price_table">
        <section>
          <div className="container">
            <div className="row">
              <div className="col-md-12">
                {/*PRICE HEADING START*/}
                <div className="price-heading clearfix">
                  <h1>Choose Your Health Plan</h1>
                </div>
                {/*//PRICE HEADING END*/}
              </div>
            </div>
          </div>
          <div className="container">
            {/*BLOCK ROW START*/}
            <div className="row">
              <div className="col-md-4">
                {/*PRICE CONTENT START*/}
                <div className="generic_content clearfix">
                  {/*HEAD PRICE DETAIL START*/}
                  <div className="generic_head_price clearfix">
                    {/*HEAD CONTENT START*/}
                    <div className="generic_head_content clearfix">
                      {/*HEAD START*/}
                      <div className="head_bg" />
                      <div className="head">
                        <span>Basic</span>
                      </div>
                      {/*//HEAD END*/}
                    </div>
                    {/*//HEAD CONTENT END*/}
                    {/*PRICE START*/}
                    <div className="generic_price_tag clearfix">
                      <span className="price">
                        <span className="sign">$</span>
                        <span className="currency">99</span>
                        <span className="cent">.99</span>
                        <span className="month">/MON</span>
                      </span>
                    </div>
                    {/*//PRICE END*/}
                  </div>
                  {/*//HEAD PRICE DETAIL END*/}
                  {/*FEATURE LIST START*/}
                  <div className="generic_feature_list">
                    <ul>
                      <li>
                        {/* <span>2GB</span>  */}
                       Zakie Package
                      </li>
                      <li>
                      <span>20%</span> Discount for aside orders
                      </li>
                      <li>
                      <span>24/7</span> Customer Services
                      </li>
                      <li>
                      Healthy follow-up with Zakie Food Health Service
                      </li>
                    </ul>
                  </div>
                  {/*//FEATURE LIST END*/}
                  {/*BUTTON START*/}
                  <div className="generic_price_btn clearfix">
                  <a className="" href="" onClick={()=>{package_submit(e,"weekly")}}>
                      Sign up
                    </a>
                  </div>
                  {/*//BUTTON END*/}
                </div>
                {/*//PRICE CONTENT END*/}
              </div>
              <div className="col-md-4">
                {/*PRICE CONTENT START*/}
                <div className="generic_content active clearfix">
                  {/*HEAD PRICE DETAIL START*/}
                  <div className="generic_head_price clearfix">
                    {/*HEAD CONTENT START*/}
                    <div className="generic_head_content clearfix">
                      {/*HEAD START*/}
                      <div className="head_bg" />
                      <div className="head">
                        <span>Standard</span>
                      </div>
                      {/*//HEAD END*/}
                    </div>
                    {/*//HEAD CONTENT END*/}
                    {/*PRICE START*/}
                    <div className="generic_price_tag clearfix">
                      <span className="price">
                        <span className="sign">$</span>
                        <span className="currency">199</span>
                        <span className="cent">.99</span>
                        <span className="month">/week</span>
                      </span>
                    </div>
                    {/*//PRICE END*/}
                  </div>
                  {/*//HEAD PRICE DETAIL END*/}
                  {/*FEATURE LIST START*/}
                  <div className="generic_feature_list">
                    <ul>
                    <li>
                        {/* <span>2GB</span>  */}
                       Zakie Package
                      </li>
                      <li>
                      <span>40%</span> Discount for aside orders
                      </li>
                      <li>
                      <span>24/7</span> Customer Services
                      </li>
                      <li>
                      Healthy follow-up with Zakie Food Health Service
                      </li>
                    </ul>
                  </div>
                  {/*//FEATURE LIST END*/}
                  {/*BUTTON START*/}
                  <div className="generic_price_btn clearfix">
                    <a className="" href="" onClick={(e)=>{package_submit(e,"monthly")}}>
                     Choose
                    </a>
                  </div>
                  {/*//BUTTON END*/}
                </div>
                {/*//PRICE CONTENT END*/}
              </div>
              <div className="col-md-4">
                {/*PRICE CONTENT START*/}
                <div className="generic_content clearfix">
                  {/*HEAD PRICE DETAIL START*/}
                  <div className="generic_head_price clearfix">
                    {/*HEAD CONTENT START*/}
                    <div className="generic_head_content clearfix">
                      {/*HEAD START*/}
                      <div className="head_bg" />
                      <div className="head">
                        <span>Unlimited</span>
                      </div>
                      {/*//HEAD END*/}
                    </div>
                    {/*//HEAD CONTENT END*/}
                    {/*PRICE START*/}
                    <div className="generic_price_tag clearfix">
                      <span className="price">
                        <span className="sign">$</span>
                        <span className="currency">299</span>
                        <span className="cent">.99</span>
                        <span className="month">/MON</span>
                      </span>
                    </div>
                    {/*//PRICE END*/}
                  </div>
                  {/*//HEAD PRICE DETAIL END*/}
                  {/*FEATURE LIST START*/}
                  <div className="generic_feature_list">
                    <ul>
                    <li>
                        {/* <span>2GB</span>  */}
                       Zakie Package
                      </li>
                      <li>
                      <span>60%</span> Discount for aside orders
                      </li>
                      <li>
                      <span>24/7</span> Customer Services
                      </li>
                      <li>
                      Healthy follow-up with Zakie Food Health Service
                      </li>
                    </ul>
                  </div>
                  {/*//FEATURE LIST END*/}
                  {/*BUTTON START*/}
                  <div className="generic_price_btn clearfix">
                  <a className="" href="" onClick={()=>{package_submit(e,"yearly")}}>
                      Sign up
                    </a>
                  </div>
                  {/*//BUTTON END*/}
                </div>
                {/*//PRICE CONTENT END*/}
              </div>
            </div>
            {/*//BLOCK ROW END*/}
          </div>
        </section>
       
      </div>
  
    );
    
}
 
export default Pricing;
